import React from 'react';
import { useNavigate, Link } from 'react-router-dom';

/// return home
export default function ReturnHome() {

 const history = useNavigate();
 const handlepath = (event) => {
  event.preventDefault();
  history.push('/pseudo');
 }

 return (
  <div class='wrp-body-home'>
   <div class="img-hm">
    <div class="flx-wrp-content">
     <h1>Ce qui se passe dans le monde et ce dont les gens parlent en ce moment.</h1>
    </div>
   </div>
   <div class="wrp-form-login">

    <div class="logo-id">
     <img src='/images/logo.png' alt='img logo kabund' />
     <h3>ALLIANCE POUR LE CHANGEMENT</h3>
    </div>

    <form>
     <label>Pseudo ID</label>

     <input type="text" placeholder='Enter votre pseudo' />
     <input type="password" placeholder='Mont de passe valide' />

     <Link to='/pseudo'>
      <button type="button" class="btn btn-primary">Suivant</button>
     </Link>
    </form>

   </div>
  </div>
 )
};
